import { BrowserRouter, Routes, Route } from "react-router-dom";



function App() {
  return (
      <div className="App">
          <BrowserRouter>

            <Routes>

              <Route path='/home' element={ <Formulario /> } />
              <Route path='/home' element={ <Home />} />
              <Route path='/login' element={ <Login/> } />

            </Routes>

          </BrowserRouter>
      </div>
  );
}

export default App;
